import React from 'react'
import './App.css'
const Course = ({ course }) => {
    console.log(course)
    return (
        <div>
            <ul>
                {course.parts.map((x, i) =>
                    <li className='list-item' key={x.id}>
                        {x.name} {x.exercises}
                    </li>)}
            </ul>
        </div>
    )
}

export default Course
